1. Military Superannuation Contributions in category 1.2 have been excluded which relate to notional employer contributions made by Defence from its departmental monies. These are to notionally fund the payments relating to MSBS, DFRB, and DFRDB defined benefits schemes;  

2. Total Defence non-financial asset additions (excluding land, buildings and infrastructure) and inventory additions have been amalgamated within category 3.1.11; 

3. All figures disclosed are provided on an accrual basis and are aligned to the 2020-21 Defence Departmental and Administered Financial Statements. Non cash relevant items such as depreciation and amortisation, write-offs, impairment loss, and inventory consumption have been excluded; 

4. Total Defence capital additions for land, buildings, and infrastructure have been amalgamated within category 3.2.6.
